import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
// import './index.less'
import App from "./App";
import * as serviceWorker from "./serviceWorker";
// import store from './store'
// import { Provider } from 'react-redux'

ReactDOM.render(
  // <Provider store={store}>
    <App />,
  // </Provider>, 
  document.getElementById("root")
